--r16
--10 minutes MB development times
--increased amounts in resource containers; white containers x10; red containers x2; used(yellow) containers are equal to red containers
--Motherbase platforms cannot have resources as "None"; Game will give not enough resources error. It looks for the resource None maybe?
--r27 NG+ Unlocked base development requirements - base dev time is 1 minute
--gmp=(.*),resourceA= ; resourceACount=(.*),resourceB= ; resourceBCount=(.*),timeMinute=(.*)\} ;
this={}
--r51 Settings
local mbBaseDev_gmpMultiplier = math.max(TUPPMSettings.mbBaseDev_gmpMultiplier or 1,0)
local mbBaseDev_resourceMultiplier = math.max(TUPPMSettings.mbBaseDev_resourceMultiplier or 1,0)

local function getMbBaseDevTime(time)
	if not TUPPMSettings.mbBaseDev_ENABLE_buildTimeOverride then
		return time
	end
	
	if TUPPMSettings.mbBaseDev_fixedBuildTime and time~=0 then
		--r52 BUGFIX fixed var name
		return math.max(TUPPMSettings.mbBaseDev_fixedBuildTime,0)
	end
	return time
end

---r68
--Change staff allowed in each unit to 700 for offline MB
local function maxStaffLimit(value)
	if not TUPPMSettings.mbBaseDev_ENABLE_maxOfflineMBStafflimits then
		return value
	end
	
	return value*7
	
end

